            </li>
            <li class=""big"">
                Queer: pessoas que transitam entre os gêneros feminino e masculino.
                O termo “queer” pertence à língua inglesa e por muito tempo foi
                utilizado de modo pejorativo. O movimento se apropriou dele para
                conceder um significativo positivo a ele;
            </li>
            <li class=""big"">
                Interssexuais: indivíduos que possuem características femininas e
