        <h2>Saúde mental de pessoas LGBT</h2>
        <p class=""big"">
            Os cuidados com a saúde mental de pessoas LGBT, é outro aspecto de suma
            importância. Sofrer violência ou ser discriminado por conta da sua
            orientação sexual é um trauma que muitas carregam. As pessoas LGBT
            passam por episódios violentos que podem desencadear depressão,
            ansiedade, fobia social, agorafobia, estresse pós-traumático, entre
            outros. Da mesma forma, presenciar recorrentes atos violentos ou somente
            ter a consciência de que eles são comuns e podem torná-lo uma vítima
            abala o estado psicológico de pessoas LGBT. Elas podem começar a
            levantar questionamentos acerca de suas identidades e propósito no
            mundo, os quais eventualmente podem instigar o desenvolvimento de
            transtornos mentais. A repressão da sexualidade, assim como a repressão
            emocional, é");
                WriteLiteral(@" prejudicial para a saúde da mente e a qualidade da vivência
            diária. Ela denota a repressão de uma parte intrínseca da condição
            humana e pode causar uma série de consequências emocionais
            desagradáveis, como insônia, ansiedade, angústia e culpa. Neste
            contexto, a importância do movimento LGBTQIA+ destaca-se pela
            possibilidade de oferecer acompanhamento psicológico para tratar
            questões emocionais associadas à orientação sexual, sexualidade e
            identidade de gênero, bem como na oferta de espaços seguros para pessoas
            LGBT. Essas iniciativas incentivam o autocuidado e combatem transtornos
            mentais debilitantes.
