                WriteLiteral(@"        <h2>O que é ser uma pessoa assexual?</h2>
        <p class=""big"">
            Uma pessoa assexual experimenta pouca ou nenhuma atração sexual. Mas
            isso não significa que ela não pratique sexo, beije e abrace em nenhuma
            circunstância. Ela pode ter atração romântica por outro indivíduo, bem
            como gostar de toques e ter o desejo de estar em um relacionamento
            afetivo. Hoje, a assexualidade é compreendida como um amplo espectro que
            reúne diversos níveis de ausência de atração sexual e romântica. A
            atração romântica é diferente da atração sexual. A primeira diz respeito
            ao desejo de ter um relacionamento amoroso e praticar atos românticos
            enquanto a segunda está ligada à vontade de ter contato sexual com
            outra(s) pessoa(s). As pessoas assexuais vivenciam diferentes graus de
            ambos os tipos de atração, por isso, não se pode afirmar que todas são
            iguais. Para exemplifi");
                WriteLiteral(@"car, confira algumas orientações sexuais que se
            encontram sob o espectro da assexualidade abaixo. Demissexual: pessoa
            sente atração sexual somente após desenvolver um vínculo afetivo com
            outra pessoa; Assexual estrito: pessoa que não sente atração sexual em
            nenhum momento; Grayssexual: pessoa que sente atração sexual somente em
            determinadas circunstâncias; Frayssexual: pessoa que sente atração
            sexual apenas quando não há um vínculo afetivo formado; Cupiossexual:
            pessoa que não sente atração sexual por outros, mas tem desejo sexual e
            vontade de ter uma vida sexual ativa; Assexual fluído: pessoa que ora se
            sente como um demissexual, ora se sente como um grayssexual. Em outras
            palavras, é alguém cujos desejos sexuais flutuam ocasionalmente.
        </p>
